	{ testResultGroupID = 1, countFloor = 10, countCelling = 15, matchType = 1, matchResult = '开心果', resultDes = '你是一个风趣幽默,且正能量满满的人。你大大咧咧的性格让你显得特别单纯，让人特别像捏几下你可爱的脸蛋!一点心机都没有，内心十分善良,是喜是悲全写在脸上。说话不喜欢拐弯抹角，有什么就说什么,也容易让人猜懂你的心事。任何人跟你在一起都会觉得十分自在没有什么压力，也因为你人畜无害的性格，所以你的身边也会聚集一大批两肋插刀的朋友。当妹纸面对这么一个天真可爱的男生时，怎能不偷偷喜欢上你呢！', resultIcon = 7595, resultForDisplayIcon = 7636 },
	{ testResultGroupID = 1, countFloor = 16, countCelling = 19, matchType = 1, matchResult = '深情', resultDes = '你的感情总是开始得小心翼翼，生怕因为自己的鲁莽而错失了自己深爱的人。在彼此相爱之后，你往往也是痴情和专注的，并且会为了爱情付出所有深情。你超懂浪漫，经常会有一些甜言蜜语。你希望能带着自己爱的人，看遍世间每处风景，留下你们爱的脚印。面对你爱的人，你的字典里没有“变心”二字，愿把一根肋骨为剑，护她一生不受伤害。', resultIcon = 7600, resultForDisplayIcon = 7643 },
	{ testResultGroupID = 1, countFloor = 20, countCelling = 22, matchType = 1, matchResult = '暖男', resultDes = '刀子嘴豆腐心。嘴上说着不可以不愿意，但心却软的像一个棉花糖，只要对你多说几句话，你立马就会心软，这可能是别人对你最多的评价。你从不故意表现，都是下意识的温暖;你可能对自己粗心大意，对别人却细心如尘;人除了有点暖还有点萌,付出不会想着索取回报。你就像个小太阳一样，不停的发热又发光。虽然你前期可能有些慢热，可一旦“焐热了”，暖起来可是连你自己都害怕!', resultIcon = 7597, resultForDisplayIcon = 7639 },
	{ testResultGroupID = 1, countFloor = 23, countCelling = 25, matchType = 1, matchResult = '正太', resultDes = '你的性格很单纯，在你的世界里非黑即白，你希望世界能够简简单单的没有伤害，你的心愿就是世界和平，你就像孩子般的天真无邪，就算被欺骗还是选择宁愿相信世界会有他的光明，这样的你很容易勾起人们的保护欲，虽然你有时候会很大气不过这也掩饰不了你有一颗小正太的心。不过，能够像一个小正太一样的活着，保持自己的天真纯洁，何尝不是一件很值得炫耀的事情呢！！', resultIcon = 7598, resultForDisplayIcon = 7640 },
	{ testResultGroupID = 1, countFloor = 26, countCelling = 28, matchType = 1, matchResult = '沧桑大叔', resultDes = '你的内心十分强大，寻常事你根本就不放在心上。你遇到棘手的事情会耐心的想办法解决，在家人和朋友身边威信极大，有点无所不能。你的性格总是极为的稳重大气，能够顾全大局，做好事情。你的心理年龄也已经超过寻常同龄人，心智早已成熟，不会动辄迁就他人。', resultIcon = 7599, resultForDisplayIcon = 7642 },
	{ testResultGroupID = 1, countFloor = 29, countCelling = 30, matchType = 1, matchResult = '高冷型男', resultDes = '或许你的外表会给人一种难以靠近的距离。你虽然有些高冷，让别人总是觉得你难以接近，但其实你的内心热情似火，十分奔放。喜欢把所有事情都自己一个人扛着，从不表露自己的内心世界，于是你就扮演着各种冷酷来掩饰，来增加彼此的距离。你是一个难以捉摸的人，因此你总是让别人想去靠近你、了解你、保护你。你看似高冷，想跟任何人保持距离感。但恰恰相反，你散发的这种魅力反而吸引了一大批的小迷妹和小迷弟。', resultIcon = 7604, resultForDisplayIcon = 7651 },
	{ testResultGroupID = 1, countFloor = 10, countCelling = 15, matchType = 2, matchResult = '古灵精怪', resultDes = '你是一个特别爱奇思妙想的人。你懂得创新，喜欢探索一切新鲜有趣的东西，你同时也对世界充满了求知欲，所以脑子里也会有很多好玩的鬼点子。虽然有时候你会给别人一种玩世不恭的感觉，但其实这都是假象！！你就像一个小精灵一样，能够给别人带来许多欢乐和浪漫，你开朗且热情。让别人感觉你就是一个有内涵的“花瓶”。跟这样的你相处久了，只会让别人越来越喜欢你。', resultIcon = 7593, resultForDisplayIcon = 7628 },
