	{ testResultGroupID = 1, countFloor = 20, countCelling = 22, matchType = 2, matchResult = '萌妹纸', resultDes = '你喜欢挑战各种新奇的事物，不喜欢被约束着，喜欢自由。所以你会和各种各样的人打交道，而浑身上下散发着可爱气息的你，很容易就可以萌到大家，成为大家心中的宝贝，得到大家的认可和呵护。在你身边的人，会情不自禁陷入你的可爱中无法自拔，看到萌萌的你，会一天都元气满满！毕竟谁都喜欢自己身边有一个萌萌哒的可爱妹纸啊。', resultIcon = 7602, resultForDisplayIcon = 7648 },
